import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import Header from "./components/Header";
import Questionnaire from "./pages/Questionnaire";
import Question from "./pages/Question";

function App() {

  return (
    <div>
      <Header />
      <Questionnaire />
      <Question />
    </div>
  );
}

export default App;
